
create table
  public.call_static_tokens_historical (
    id uuid not null,
    token text not null,
    hash text not null,
    timestamp bigint not null,
    sol_amount bigint not null,
    token_amount bigint not null,
    price numeric(20, 10) not null,
    dex integer not null,
    buyer text null,
    virtual_sol_reserves bigint null,
    virtual_token_reserves bigint null,
    real_sol_reserves bigint null,
    real_token_reserves bigint null,
    is_buy boolean null,
    constraint call_static_tokens_historical_pkey primary key (id),
    constraint call_static_tokens_historical_hash_key unique (hash)
  ) tablespace pg_default;

create index if not exists idx_token on public.call_static_tokens_historical using btree (token) tablespace pg_default;

create index if not exists idx_price on public.call_static_tokens_historical using btree (price) tablespace pg_default;

create index if not exists idx_timestamp on public.call_static_tokens_historical using btree ("timestamp") tablespace pg_default;




